jQuery(document).ready(function(){$(".btnAddDevice").on("click",function(n){n.preventDefault();var t=$("#longitude").val(),i=$("#latitude").val(),r=$("#address").val();$.post("device/create/?longitude="+t+"&latitude="+i+"&address="+encodeURIComponent(r),function(n){$("#deviceIdWrapper").show();$("#deviceId").text(n);$("#longitude").val("");$("#latitude").val("");$("#address").val("")})});$.get("heatmap/points",function(n){initMap(n)})});var getUrlParameter=function(n){for(var u=decodeURIComponent(window.location.search.substring(1)),r=u.split("&"),t,i=0;i<r.length;i++)if(t=r[i].split("="),t[0]===n)return t[1]===undefined?!0:t[1]};